import React, { useState, useEffect } from 'react';
const Api = () => {
    const [num, setnum] = useState(null);
    // const [l, setl] = useState("delhi");
    useEffect(() => {
        const call = async() => {
            const url = `https://api.openweathermap.org/data/2.5/weather?q=&appid=4383b6ffbb1abd2ec80cc0324a66f8b7`;
            const res = await fetch(url);
            const ress = await res.json();
            setnum(ress);
           
        }
        call();
    })

    return ( <
        h1 > hello dude { num } < /h1>

    )
}
export default Api;
